import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import './App.css';
import About from "./Pages/Home/About/About";
import Home from "./Pages/Home/Home/Home";
import Users from "./Pages/Home/Users/Users";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route path="/about">
          <About/>
        </Route>
        <Route path="/users">
          <Users/>
        </Route>
        <Route path="/">
          <Home/>
        </Route>
      </Switch>

    </div>
  );
}

export default App;
